import React from 'react';
import './TopMenu.css';

class TopMenu extends React.Component {
  
  render() {
    return (
      <div classMenu="menu top">
        <div className="title">

        </div>
        <div className="options">
          <div className="option">
            Button 1
          </div>
          <div className="option">
            Button 2
          </div>
        </div>
      </div>
    )
  }
}

export default TopMenu;
